import React from 'react';
import { Container, Button, useTheme } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import Notifications from '../components/Notifications';

const mockAdminNotifications = [
  {
    title: 'System Maintenance',
    message: 'Scheduled maintenance on Saturday from 2 AM to 4 AM.',
  },
  {
    title: 'New User Registrations',
    message: '5 new users registered this week.',
  },
  {
    title: 'Policy Update',
    message: 'Please review the updated privacy policy.',
  },
];

const AdminNotifications = () => {
  const theme = useTheme();
  const navigate = useNavigate();

  return (
    <Container sx={{ mt: 6, mb: 6 }}>
      <Button variant="contained" color="secondary" onClick={() => navigate('/admin')} sx={{ mb: 3 }}>
        Back to Dashboard
      </Button>
      <Notifications notifications={mockAdminNotifications} />
    </Container>
  );
};

export default AdminNotifications;
